import React from 'react'
import {Box, FormControl, makeStyles,Button, InputBase} from '@material-ui/core'
import Add from '@material-ui/icons';

const styleclass=makeStyles()

function UpdatePost() {
    const style=styleclass()
    return (
        <Box className={style.container}>
            <img src="" alt="banner image" />
            <FormControl>
                <Add />
                <InputBase placeholder="title of blog" /> 
                <Button type="container" >Publish </Button>
            </FormControl>
        </Box>    
    )
}

export default UpdatePost
